const image = new Image();
image.src = 'data:image/png;base64,';

const infoCanvas = document.getElementById('canvas1');
const infoCtx = infoCanvas.getContext('2d');
infoCanvas.width = w;
infoCanvas.height = h;







let infoCanvasParticlesArray = [];

function infoCanvasFunction(){
    let devision = 10;
    let multiplayer = 6.25;     

    let width = image.width / devision;
    let height = image.height / devision;

    infoCtx.drawImage(image, 0, 0, width, height);
    const pixels = infoCtx.getImageData(0, 0, width, height);
    infoCtx.clearRect(0, 0, infoCanvas.width, infoCanvas.height);

    let grid = [];
    for (let y = 0; y < height; y++){
        let row = [];
        for (let x = 0; x < width; x++){
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)]
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)]
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)]
            

            if(red > 0 || green > 0 || blue > 0){
                const color = 'rgb(' + red +',' + green + ',' + blue + ')';
                const cell = {
                    cellColor: color,
                    cellX: x * multiplayer,
                    cellY: y * multiplayer
                }; 
                row.push(cell);
            }else{
                const cell = null
                row.push(cell);
            }     
            
        }  

        grid.push(row); 
    }

    

    function init(){
        for (let y = 0; y < grid.length; y++){
            for (let x = 0; x < grid[y].length; x++){
                if(grid[y][x] != null){
                    let color = grid[y][x].cellColor;
                    let imgW = width * multiplayer/2;
                    let imgH = height * multiplayer/2;

                    let particleX = grid[y][x].cellX;
                    let particleY = grid[y][x].cellY;
    
                    infoCanvasParticlesArray.push(new ParticleWithTargetAndColor(color, particleX, particleY,  imgW, imgH));
                }
            }
        }
    }

    init();

    
    updateInfoCanvasPosBySize();

    function animate () {
        infoCtx.fillStyle = 'rgb(0, 0, 0)';
        infoCtx.fillRect(0, 0, infoCanvas.width, infoCanvas.height);
        for (let i = 0; i < infoCanvasParticlesArray.length; i++) {
            infoCanvasParticlesArray[i].calculate();
            infoCanvasParticlesArray[i].draw();
        }
        requestAnimationFrame( animate );
    }

    

    setTimeout(function (){
        animate();
    }, 7500);
}

function updateInfoCanvasPosBySize(){
    if(w > 750){
        offsetParticleFromRight(infoCanvasParticlesArray, -w * 0.3, 0);
    }else{
        offsetParticleFromCeter(infoCanvasParticlesArray,  0, 0);
        infoCanvas.height += 300;
    }
}

